import Expenses from "./Components/Expenses";


function App() {
    const expenseData = [
        {
            id: 'e1',
            expenseTitle: 'Car Insurance',
            amount: 9999,
            date: new Date(2021, 2, 28),
        }, 
        {
            id: 'e2',
            expenseTitle: 'Car Insurance',
            amount: 9999,
            date: new Date(2021, 2, 28),
        },
         {
            id: 'e3',
            expenseTitle: 'Car Insurance',
            amount: 9999,
            date: new Date(2021, 2, 28),
        },
    ];

    return (
      <div  className="expenses">
       <Expenses className="expenses" expense= {expenseData}></Expenses>
       </div>
    );
}

export default App;
